import React, {useState} from 'react';
import {Col, Row, Form, Switch, Button, Descriptions,} from 'antd';
import { Statistic } from 'antd';
import { Typography } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { List, Input, Space } from 'antd';
import axios from "axios";
import Card from "antd/es/card/Card";
const { Search } = Input;


const Home = () => {
    const { Title } = Typography;
    const onSearch = (value) => {
        console.log(value);
        let url = 'http://localhost:8080/stock/queryprice/' + value;
        axios.get(url)
            .then(function (response) {
                let data=response.data.data;
                if(data !== "-1"){
                    console.log(data);

                }else{
                    console.log("fuck");
                }
            })
            .catch(function (error) {
                console.log(error);
            });
    };

    return (
        <div>
            <div>
                <Title level={1}>STOCK MANAGEMENT</Title>
            </div>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Space>
                            <Search
                                placeholder="Input stock sym"
                                enterButton="Query"
                                size="large"
                                onSearch={onSearch}
                            />
                        </Space>
                    </Col>
                    <Col span ={8}></Col>
                </Row>
            </div>
            <div className="site-card-wrapper">
                <Row gutter={16}>
                    <Col span={8}>
                        <Card title="Card title" bordered={false}>
                            Card content
                        </Card>
                    </Col>
                </Row>
            </div>
            <div>
                <Row gutter={16}>
                    <Col span={12}>
                        <Statistic title="Active Users" value={112893} />
                    </Col>
                    <Col span={12}>
                        <Statistic title="Account Balance (CNY)" value={112893} precision={2} />
                        <Button
                            style={{
                                marginTop: 16,
                            }}
                            type="primary"
                        >
                            Recharge
                        </Button>
                    </Col>
                    <Col span={12}>
                        <Statistic title="Active Users" value={112893} loading />
                    </Col>
                </Row>
            </div>
        </div>
    );
};

export default Home;
